import PropTypes from "prop-types";
import styles from "./FrameComponent4.module.css";

const FrameComponent4 = ({ className = "" }) => {
  return (
    <section className={[styles.caregiverContentWrapper, className].join(" ")}>
      <div className={styles.caregiverContent}>
        <div className={styles.ourBestHighlyPerformCaregiWrapper}>
          <h1 className={styles.ourBestHighly}>
            Our Best Highly Perform Caregiver
          </h1>
        </div>
        <div className={styles.caregiverImages}>
          <img
            className={styles.component24Icon}
            loading="lazy"
            alt=""
            src="/component-24@2x.png"
          />
          <img
            className={styles.component25Icon}
            loading="lazy"
            alt=""
            src="/component-25@2x.png"
          />
          <img
            className={styles.component25Icon1}
            loading="lazy"
            alt=""
            src="/component-25-1@2x.png"
          />
          <img
            className={styles.component26Icon}
            loading="lazy"
            alt=""
            src="/component-26@2x.png"
          />
        </div>
      </div>
    </section>
  );
};

FrameComponent4.propTypes = {
  className: PropTypes.string,
};

export default FrameComponent4;
